import React from 'react';

const Login = () => {
    return (
        <div className="bg-white w-full min-h-screen flex items-center justify-center px-4">
      <div className="login-screen w-full max-w-4xl flex items-start">
        {/* Div Azul */}
        <div className="relative w-1/2 h-full flex flex-col bg-blue-500 p-10">
          <h1 className="text-white">Div Azul</h1>
        </div>

        {/* Div Branca */}
        <div className="relative w-1/2 h-full flex flex-col bg-white p-10">
          <h1 className="text-black">Div Branca</h1>
        </div>
      </div>
    </div>
    );
  };
  
  
  
export default Login;
